import Grid from "@mui/material/Grid";
import Divider from "@mui/material/Divider";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import Header from "layouts/profile/components/Header";
import MDButton from "components/MDButton";
import { useState, useEffect } from "react";

function Overview() {
  const [data, setData] = useState([]);
  const [isEditMode, setIsEditMode] = useState(false);

  const handleEditClick = () => {
    setIsEditMode(!isEditMode);
  };

  useEffect(() => {
    const profileFetch = async () => {
      try {
        const response = await fetch(`http://localhost:5001/profileData`);
        const result = await response.json();
        setData(result);
        console.log(result);
      } catch (error) {
        console.error("Error fetching test data:", error);
      }
    };
    profileFetch();
  }, []);

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <Header title="Profile" subtitle="Manage your profile settings" />
      <Box p={3}>
        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Box sx={{ display: "flex", alignItems: "center" }}>
              <Divider orientation="vertical" flexItem />
              <Box ml={2}>
                <TextField
                  fullWidth
                  id="id"
                  label={data.length === 0 ? "ID" : data[0]?.ID ? "ID" : ""}
                  disabled={!isEditMode} // Disable input based on edit mode
                  variant="outlined"
                  defaultValue={data[0]?.ID || ""}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="date-of-joining"
                  label={data.length === 0 ? "Date of Joining" : data[0]?.doj ? "Date of Joining" : ""}
                  disabled={!isEditMode} 
                  variant="outlined"
                  defaultValue={data[0]?.doj || ""}
                  InputLabelProps={{
                    shrink: true,
                  }}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  disabled={!isEditMode} 
                  id="date-of-birth"
                  label={data.length === 0 ? "Date of Birth" : data[0]?.dob ? "Date of Birth" : ""}
                  type="date"
                  variant="outlined"
                  defaultValue={data[0]?.dob || ""}
                  InputLabelProps={{
                    shrink: true,
                  }}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="phone"
                  label={data.length === 0 ? "Phone No." : data[0]?.phone ? "Phone No." : ""}
                  disabled={!isEditMode} 
                  variant="outlined"
                  defaultValue={data[0]?.phone || ""}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="email"
                  label={data.length === 0 ? "Email" : data[0]?.email ? "Email" : ""}
                  disabled={!isEditMode} 
                  variant="outlined"
                  defaultValue={data[0]?.email || ""}
                  sx={{ marginBottom: "20px" }}
                />
                <TextField
                  fullWidth
                  id="address"
                  label={data.length === 0 ? "Address" : data[0]?.address ? "Address" : ""}
                  disabled={!isEditMode} 
                  multiline
                  rows={4}
                  variant="outlined"
                  defaultValue={data[0]?.address || ""}
                  sx={{ marginBottom: "20px" }}
                />
              </Box>
            </Box>
            <Box sx={{ marginLeft: '600px' }}>
              <MDButton color="info" onClick={handleEditClick}>{isEditMode ? 'Save' : 'Edit'}</MDButton>
            </Box>
          </Grid>
        </Grid>
      </Box>
      <Footer />
    </DashboardLayout>
  );
}

export default Overview;
